import React from "react";
import "./Navbar.css";
function Navbar() {
  return (
    <nav>
      <input type="text" placeholder="Enter the product name" />
      <div className="icons">
        <i class="bi bi-heart-fill"></i>
        <i class="bi bi-cart2"></i>
        <i class="bi bi-person-add"></i>
      </div>
    </nav>
  );
}

export default Navbar;
